import React from "react";

function Home() {
  return (
    <>
      <p className="mx-auto p-6 bg-white rounded-lg shadow-md text-l mt-5 w-2.5">
        Welcome to Modern Food Tales, where the art of cooking meets the joy of
        sharing. Our food blog is a vibrant celebration of flavors, ingredients,
        and culinary creativity. Whether you're a seasoned chef or a home cook
        looking for inspiration, we offer a variety of recipes, cooking tips,
        and food stories designed to elevate your kitchen experience. From
        delectable appetizers to indulgent desserts, each recipe is thoughtfully
        crafted with the finest ingredients and clear instructions, making
        gourmet cooking accessible to all. Join us on a culinary journey and
        explore the diverse world of food with exciting new dishes, seasonal
        favorites, and behind-the-scenes glimpses into the world of cooking.
        With Modern Food Tales, every meal is an opportunity to explore, savor,
        and enjoy.
      </p>
    </>
  );
}
export default Home;
